import './Registro.css'

function Registro(){
    return(
        <div className="registro-container card-block ">
            <div className="card">
                <h1>Registro</h1>

                <form>
                    <label>

                    <input type="text" />
                    </label>
                </form>
            </div>
        </div>
    )
}

export default Registro;
